import Layout from '../components/MyLayout';
import { useRouter } from 'next/router';

const Content = () => {
	const router = useRouter();

	return (
		<div>
			<h1>{router.query.title}</h1>
			<h2>Features of this page</h2>
			<ul>
				<li>Feature 1: Book your class, choose founder (link to MBO)</li>
				{/* <li>Feature 2: Review lesson feature. What exercises do you remember during the class?</li> */}
				<li>Feature 2: Comments</li>
				<li>Feature 3: Feedback from instructor</li>
			</ul>
		</div>
	);
};

const Page = () => (
	<Layout>
		<Content />
	</Layout>
);

export default Page;
